import React, { useState } from 'react'

interface propTypes{
  date:string,
  criteria:string
}

function Hospital() {

  const [discharge,setDischarge] =useState<propTypes>({
    date:'',
    criteria:''
  })

  const setDate = (date:string) =>{
    setDischarge({...discharge,date})
  }

  const setCriteria = (criteria:string) =>{
    setDischarge({...discharge,criteria})
  }

  console.log("Hospital",JSON.stringify(discharge,null,2))

  return (
    <div>
     <div><input value={discharge.date} onChange={({target})=>setDate(target.value)} type='date'/></div> 
     <br/>
     <div> <input value={discharge.criteria} onChange={({target})=>setCriteria(target.value)} type='text'/></div>
    </div>
  )
}

export default Hospital
